  \"september-2004-lidar-point-data-of-southern-california-coastline-long-beach-to-us-mexican-borde\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains lidar point data
  (Geodetic Coordinates) from a strip of Southern California coastline (including
  water, beach, cliffs, and top of cliffs) from Long Beach to the US/Mexico border.
  The data set was created by combining data collected using an Optech Inc. Airborne
  Laser Terrain Mapper (ALTM) 1225 in combination with geodetic quality Global Positioning
  System (GPS) airborne and ground-based receivers. The Bureau of Economic Geology,
  the University of Texas at Austin owns and operates an ALTM 1225 system (serial
  number 99d118). The system was installed in a twin engine Partenavia P-68 (tail
  number N6602L) owned and operated by Aspen Helicopter, Inc. The lidar data set described
  by this document was collected on 28-30 September 2004; Julian Days 27204, 27304,
  and 27404 (see Lineage, Source_Information, Source_Contribution for pass information).
  99d118 instrument settings for these flights were; laser pulse rate: 25kHz, scanner
  rate: 26Hz, scan angle: +/- 20deg, beam divergence: narrow, altitude: 950-1150m
  AGL, and ground speed: 90-132kts. Settings were different on final day of surveying
  due to low clouds and flight restrictions: beam divergence: wide, altitude: 320-620m
  AGL, and ground speed: 101-121kts. Three GPS base stations (Seal Beach, Dana Point,
  and Point Loma, see Lineage, Source_Information, Source_Contribution for coordinates)
  were operating during the survey. Data represented is all points including terrain,
  vegetation, and structures. This data also contains returns from the water surface.
  No processing has been done to remove returns from terrain, vegetation, structures
  or water surfaces.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
